import React from 'react';

const Card = React.forwardRef(({ id, name, email }, ref) => {
  return (
    <div ref={ref}>
      <img src={`https://robohash.org/${id}?size=200x200`} alt='robots' />
      <div>
        <a ref={ref}>{name}</a>
        <p>{email}</p>
      </div>
    </div>
  );
});

export default Card;
